package models

import (
	"time"
)

type (
	// Snippet model.
	Snippet struct {
		// ID - snippet autogenerated ID.
		ID int
		// Created - date of snippet creation.
		Created time.Time
		// Expires - date of snippet expiration.
		Expires time.Time
		// Title - snippet title.
		Title string
		// Content - snippet content.
		Content string
	}
)
